import{_ as e,o as a,c as d,b as t}from"./app.6e46cfcf.js";const p=JSON.parse('{"title":"设计","description":"","frontmatter":{},"headers":[{"level":2,"title":"项目名称","slug":"项目名称","link":"#项目名称","children":[{"level":3,"title":"寓意","slug":"寓意","link":"#寓意","children":[]}]},{"level":2,"title":"项目 Logo","slug":"项目-logo","link":"#项目-logo","children":[{"level":3,"title":"想法","slug":"想法","link":"#想法","children":[]},{"level":3,"title":"寓意","slug":"寓意-1","link":"#寓意-1","children":[]}]}],"relativePath":"docs/design.md","lastUpdated":1676984406000}'),r={name:"docs/design.md"},i=t('<h1 id="设计" tabindex="-1">设计 <a class="header-anchor" href="#设计" aria-hidden="true">#</a></h1><h2 id="项目名称" tabindex="-1">项目名称 <a class="header-anchor" href="#项目名称" aria-hidden="true">#</a></h2><p>Hview-UI</p><h3 id="寓意" tabindex="-1">寓意 <a class="header-anchor" href="#寓意" aria-hidden="true">#</a></h3><p>往往学习编程的第一句代码都是 Hello World，而我们开发组件库也是第一次开发，我们的组件库也是参照已有的组件库进行开发和学习，而 view 有观察的意思并且和 vue 同音，所以我们将 h 和 view 融合在了一起，给组件库命名为 hview-ui 寓意我们这个新生的组件库通过学习融合现有组件库的优点，希望能为大家呈现出一个不错的组件库项目</p><br><h2 id="项目-logo" tabindex="-1">项目 Logo <a class="header-anchor" href="#项目-logo" aria-hidden="true">#</a></h2><p><a href="https://camo.githubusercontent.com/33905ebd43fab53ba7ddf546e5a34e5618d61beca3bed4c440c9bf01c9712339/68747470733a2f2f6f73732e7a686973686979752e6f6e6c696e652f6d61726b646f776e5f696d616765732f3230323330313139313930383839362e706e67" target="_blank" rel="noreferrer"><img src="https://camo.githubusercontent.com/33905ebd43fab53ba7ddf546e5a34e5618d61beca3bed4c440c9bf01c9712339/68747470733a2f2f6f73732e7a686973686979752e6f6e6c696e652f6d61726b646f776e5f696d616765732f3230323330313139313930383839362e706e67" alt="img"></a></p><h3 id="想法" tabindex="-1">想法 <a class="header-anchor" href="#想法" aria-hidden="true">#</a></h3><p>view 还有透视、视图的意思，这里就用了三个不同视图方向的图案组成这个 H 让其变成立体多面效果</p><h3 id="寓意-1" tabindex="-1">寓意 <a class="header-anchor" href="#寓意-1" aria-hidden="true">#</a></h3><p>我们的组件库还存在很多不完善的地方，非常希望广大开发人员能够使用我们组件库和给我们进行反馈和提问，我们会虚心接受，然后接纳大家的意见，不断迭代出让开发者满意的项目</p>',12),c=[i];function l(n,h,o,s,f,_){return a(),d("div",null,c)}const u=e(r,[["render",l]]);export{p as __pageData,u as default};
